Downloads a file from a Blob storage to a specified file on the local system using Azure Blob storage client. This method supports downloading a specific range of a blob or retrying the request upon failure by specifying appropriate options.

@param file The path of the file to which the blob content will be downloaded. 
@param range Optional, a BlobRange object representing the start and end byte positions to download from the blob. By default, it downloads the whole blob.
@param parallelTransferOptions Optional, a ParallelTransferOptions object controlling the concurrency of downloads.
@param downloadRetryOptions Optional, a DownloadRetryOptions object specifying how many times the request should be retried when errors occur during the transfer. By default, no retries are performed.
@param blobRequestConditions Optional, a BlobRequestConditions object that contains optional conditions that must be met before performing the operation. For example, if this value is not null and it specifies that an ETag condition must be satisfied but the server returns 412 (Precondition Failed), then the operation fails.
@param truncateRange Optional, a boolean indicating whether or not to truncate the file at the position specified by the range parameter before downloading. If true, the file is truncated; if false, the file isn't truncated and the request will fail if it attempts to write past the current end of the file.
@return A CompletableFuture that completes when the blob content has been fully downloaded. When completed, the response contains information about the status of the operation, such as the ETag value for the downloaded blob.

Gets the String or Long id from the key, or null if incomplete, but only for Google Cloud Datastore Key 

```java
@SuppressWarnings("unchecked")
public static <S> Value<S> getIdValue(final IncompleteKey key) {
	if (key instanceof com.google.cloud.datastore.Key) {
		final com.google.cloud.datastore.Key completeKey = (com.google.cloud.datastore.Key)key;
		if (completeKey.hasId())
			return (Value<S>)LongValue.of(completeKey.getId());
		else
			return (Value<S>)StringValue.of(completeKey.getName());
	} else {
		return null;
	}
}
